int	main(void)
{

	// atexit(leak);

	int		fd = open("big_line_no_nl.txt", O_RDONLY);
	char	*new_line;
	int		count = 0;

	gnl(fd,"");
	gnl(fd, NULL);

	new_line = get_next_line(fd);

	while (1)
	{
		if (new_line == NULL)
			break;
		count++;
		printf("%s", new_line);
		free(new_line);
		new_line = get_next_line(fd);
	}
	close(fd);
	return (0);
}
